import { Link, NavLink } from "react-router-dom";
const Navbar = () => {
  return (
    <div class="navbar">
    <div class="navbar-item">
      <a class="link" href="./register.html">Register</a>
    </div>
    <div class="navbar-item">
      <a class="link" href="./manage.html">Manage</a>
    </div>
  </div>
  );
};

export default Navbar;
